export default (function(a,b,c,d,e,f,g){return {data:{GEmxDYKvkZ:{data:{id:1734,attributes:{imdbId:"tt0107290",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMjM2MDgxMDg0Nl5BMl5BanBnXkFtZTgwNTM2OTM5NDE@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"8.1\u002F10"},{Source:"Rotten Tomatoes",Value:"92%"},{Source:"Metacritic",Value:"68\u002F100"}],item_lang:{data:{id:2397,attributes:{title:a,plot:"Huge advancements in scientific technology have enabled a mogul to create an island full of living dinosaurs. John Hammond has invited four individuals, along with his two grandchildren, to join him at Jurassic Park. But will everything go according to plan? A park employee attempts to steal dinosaur embryos, critical security systems are shut down and it now becomes a race for survival with dinosaurs roaming freely over the island.",slug:"jurassic-park"}}},books:{data:[{id:8904,attributes:{title:a,description:"#1 NEW YORK TIMES BESTSELLER • From the author of Timeline, Sphere, and Congo, this is the classic thriller of science run amok that took the world by storm. Nominated as one of America’s best-loved novels by PBS’s The Great American Read “[Michael] Crichton’s dinosaurs are genuinely frightening.”—Chicago Sun-Times An astonishing technique for recovering and cloning dinosaur DNA has been discovered. Now humankind’s most thrilling fantasies have come true. Creatures extinct for eons roam Jurassic Park with their awesome presence and profound mystery, and all the world can visit them—for a price. Until something goes wrong. . . . In Jurassic Park, Michael Crichton taps all his mesmerizing talent and scientific brilliance to create his most electrifying technothriller. Praise for Jurassic Park “Wonderful . . . powerful.”—The Washington Post Book World “Frighteningly real . . . compelling . . . It’ll keep you riveted.”—The Detroit News “Full of suspense.”—The New York Times Book Review",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=V5s14nks9I8C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:true,published:"2012-05-14",publisher:e,subtitle:f}},{id:8905,attributes:{title:a,description:"Before seeing Jurassic World film this June read the original, multimillion copy No. 1 bestselling thriller that inspired the first major motion picture Jurassic Park. On a remote jungle island, genetic engineers have created a dinosaur game park. An astonishing technique for recovering and cloning dinosaur DNA has been discovered. Now one of mankind's most thrilling fantasies has come true and the first dinosaurs that the Earth has seen in the time of man emerge. But, as always, there is a dark side to the fantasy and after a catastrophe destroys the park's defence systems, the scientists and tourists are left fighting for survival... With this masterful cross of science fiction and action-adventure, Michael Crichton created one of the biggest bestsellers of all time, turned by Steven Spielberg into the highest grossing blockbuster ever in 1993.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=uo7TsgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:c,published:"2015-05-21",publisher:"Arrow Books",subtitle:d}},{id:8906,attributes:{title:g,description:"#1 NEW YORK TIMES BESTSELLER • From the author of Timeline, Sphere, and Congo comes the sequel to the smash-hit Jurassic Park, a thriller that’s been millions of years in the making. “Fast and gripping.”—The Washington Post Book World It is now six years since the secret disaster at Jurassic Park, six years since the extraordinary dream of science and imagination came to a crashing end—the dinosaurs destroyed, the park dismantled, and the island indefinitely closed to the public. There are rumors that something has survived. . . . “Harrowing thrills . . . fast-paced and engaging.”—People “A very scary read.”—Entertainment Weekly “Action-packed.”—New York Daily News “An edge-of-the-seat tale.”—St. Petersburg Times",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=LwgTiSuSWFEC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:c,published:"2001-01-18",publisher:e,subtitle:f}},{id:8907,attributes:{title:a,description:"Chronicles the chaos that ensues when the prehistoric monsters living in a theme park run amok",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Q2877pdHhwUC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["Gail Herman",b,"David Koepp"],firstBook:c,published:"1993-01-01",publisher:"Price Stern Sloan",subtitle:"The Junior Novelization"}},{id:8908,attributes:{title:a,description:d,thumbnail:d,authors:[b],firstBook:c,published:"1990-01-01",publisher:d,subtitle:g}}]}}},meta:{}}},prerenderedAt:1680940961791}}("Jurassic Park","Michael Crichton",null,"","Ballantine Books","A Novel","The Lost World"))